-- ----------------------------
-- Table structure for `amazon`
-- ----------------------------
DROP TABLE IF EXISTS `amazon`;
CREATE TABLE `amazon` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `created_man` int(11) DEFAULT '0' COMMENT '操作者',
  `platform_information_id` int(11) DEFAULT '0' COMMENT '平台草稿箱共有部分id',
  `goods_attribute_id` int(11) DEFAULT '0' COMMENT '商品属性id',
  `promotion_price` decimal(10,2) DEFAULT '0.00' COMMENT '促销价格（亚马逊）',
  `promotion_end_time` datetime DEFAULT NULL COMMENT '促销jiesu时间',
  `promotion_start_time` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '促销开始时间',
  `seller_sku` varchar(50) DEFAULT '' COMMENT 'SellerSKU(亚马逊)',
  `product_value` varchar(200) DEFAULT NULL COMMENT '商品编码（亚马逊） UPC/ASIN',
  `product_code` varchar(50) DEFAULT '' COMMENT '商品编码（亚马逊） UPC/ASIN',
  `item_condition` varchar(50) DEFAULT '' COMMENT '物品状态（亚马逊）',
  `goods_brand` varchar(100) DEFAULT '' COMMENT '商品品牌（亚马逊）',
  `manufacturers` varchar(100) DEFAULT '' COMMENT '制造商（亚马逊）',
  `goods_color` varchar(100) DEFAULT '' COMMENT '商品颜色（亚马逊）',
  `goods_model` varchar(100) DEFAULT '' COMMENT '商品型号（亚马逊）',
  `keywords1` varchar(500) DEFAULT '' COMMENT '关键词1（亚马逊）',
  `keywords2` varchar(500) DEFAULT '' COMMENT '关键词2（亚马逊）',
  `keywords3` varchar(500) DEFAULT '' COMMENT '关键词3（亚马逊）',
  `keywords4` varchar(500) DEFAULT '' COMMENT '关键词4（亚马逊）',
  `keywords5` varchar(500) DEFAULT '' COMMENT '关键词5（亚马逊）',
  `goods_label1` varchar(500) DEFAULT '' COMMENT '商品标签1（亚马逊）',
  `goods_label2` varchar(500) DEFAULT '' COMMENT '商品标签2（亚马逊）',
  `goods_label3` varchar(500) DEFAULT '' COMMENT '商品标签3（亚马逊）',
  `goods_label4` varchar(500) DEFAULT '' COMMENT '商品标签4（亚马逊）',
  `goods_label5` varchar(500) DEFAULT '' COMMENT '商品标签5（亚马逊）',
  `updated_dec` varchar(500) DEFAULT '' COMMENT '更新失败原因(亚马逊)',
  `weight` decimal(14,2) DEFAULT '0.00' COMMENT '商品重量(kg) （亚马逊）',
  `length` decimal(14,2) DEFAULT '0.00' COMMENT '商品长(kg) （亚马逊）',
  `wide` decimal(14,2) DEFAULT '0.00' COMMENT '商品宽(kg) （亚马逊）',
  `high` decimal(14,2) DEFAULT '0.00' COMMENT '商品高(kg) （亚马逊）',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `user_id` int(11) DEFAULT '0' COMMENT '用户id',
  PRIMARY KEY (`id`),
  KEY `idx_cman` (`created_man`),
  KEY `idx_pfid` (`platform_information_id`),
  KEY `idx_gaid` (`goods_attribute_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='亚马逊草稿箱';

-- ----------------------------
-- Records of amazon
-- ----------------------------

-- ----------------------------
-- Table structure for `amazon_api_service_request`
-- ----------------------------
DROP TABLE IF EXISTS `amazon_api_service_request`;
CREATE TABLE `amazon_api_service_request` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `method` varchar(50) DEFAULT '' COMMENT '方法名',
  `params` varchar(1000) DEFAULT '' COMMENT 'xml数据预处理',
  `request_table` varchar(50) DEFAULT '' COMMENT '请求表',
  `request_pk` varchar(50) DEFAULT '' COMMENT '请求表主键',
  `request_user_id` int(11) DEFAULT '0' COMMENT '请求发起账户id',
  `request_shop_id` int(11) DEFAULT '0' COMMENT '请求发起店铺id',
  `is_finished` tinyint(2) DEFAULT '0' COMMENT '0:未请求 1:请求成功 2:请求失败',
  `exception_info` varchar(1000) DEFAULT '' COMMENT '异常信息',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `FeedSubmissionId` varchar(50) DEFAULT '' COMMENT 'FeedId 上传数据处理id',
  PRIMARY KEY (`id`),
  KEY `idx_fini` (`is_finished`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='亚马逊请求队列';

-- ----------------------------
-- Records of amazon_api_service_request
-- ----------------------------

-- ----------------------------
-- Table structure for `amazon_api_service_response`
-- ----------------------------
DROP TABLE IF EXISTS `amazon_api_service_response`;
CREATE TABLE `amazon_api_service_response` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `api_name` varchar(50) DEFAULT '' COMMENT 'API名称',
  `RequestId` varchar(50) DEFAULT '' COMMENT '请求id 追溯异常',
  `FeedSubmissionId` varchar(50) DEFAULT '' COMMENT 'FeedId 上传数据处理id',
  `FeedType` varchar(50) DEFAULT '' COMMENT 'FeedType 上传数据类型',
  `SubmittedDate` varchar(50) DEFAULT '' COMMENT 'SubmittedDate 上传数据时间',
  `FeedProcessingStatus` varchar(50) DEFAULT '' COMMENT 'Feed的处理状态 _AWAITING_ASYNCHRONOUS_REPLY_:正在处理请求，但在完成之前正在等待外部信息。_CANCELLED_:由于致命错误，请求已中止。  _DONE_:该请求已被处理。您可以调用GetFeedSubmissionResult操作来接收处理报告，该报告描述了Feed中哪些记录成功以及哪些记录生成了错误。 _IN_PROGRESS_:请求正在处理中。 _IN_SAFETY_NET_:正在处理请求，但系统已确定Feed中存在潜在错误（例如，请求将从卖家帐户中删除所有库存。）亚马逊卖家支持人员将与卖家联系以确认是否有Feed应该处理。 _SUBMITTED_:该请求已收到，但尚未开始处理。 _UNCONFIRMED_:该请求正在等待中。',
  `request_user_id` int(11) DEFAULT '0' COMMENT '请求发起账户id',
  `request_shop_id` int(11) DEFAULT '0' COMMENT '请求发起店铺id',
  `is_finished` tinyint(2) DEFAULT '0' COMMENT '0:未完成 1:已完成',
  `param` varchar(1000) DEFAULT '' COMMENT '请求参数',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `idx_u_id` (`request_user_id`) USING BTREE,
  KEY `idx_s_id` (`request_shop_id`) USING BTREE,
  KEY `idx_is_fini` (`is_finished`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='亚马逊请求响应处理表';

-- ----------------------------
-- Records of amazon_api_service_response
-- ----------------------------

