  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `goods_attribute_id` int(11) DEFAULT '0' COMMENT '商品属性id',
  `category_id_1` int(11) DEFAULT '0' COMMENT '一级分类ID',
  `category_id_2` int(11) DEFAULT '0' COMMENT '二级分类ID',
  `category_id_3` int(11) DEFAULT '0' COMMENT '三级分类ID',
  `created_man` int(11) DEFAULT '0' COMMENT '操作者',
  `sku` varchar(100) DEFAULT '' COMMENT '自定义SKU',
  `goods_name` varchar(255) DEFAULT '' COMMENT '商品名称',
  `goods_pictures` varchar(500) DEFAULT '' COMMENT '商品主图',
  `synchronization` tinyint(2) DEFAULT '1' COMMENT '1未同步 2同步失败 3同步成功',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '1:草稿 2:审核通过',
  `goods_title` varchar(500) DEFAULT '' COMMENT '商品标题',
  `goods_height` decimal(10,2) DEFAULT '0.00' COMMENT '高，单位CM',
  `goods_width` decimal(10,2) DEFAULT '0.00' COMMENT '宽，单位CM',
  `goods_length` decimal(10,2) DEFAULT '0.00' COMMENT '长，单位CM',
  `goods_weight` decimal(10,2) DEFAULT '0.00' COMMENT '重量,单位KG',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `description` varchar(1000) DEFAULT NULL COMMENT '商品描述',
  `plat` tinyint(2) NOT NULL DEFAULT '1' COMMENT '1乐天 2亚马逊',
  `from_url` varchar(264) DEFAULT NULL COMMENT '商品来源',
  `user_id` int(11) DEFAULT '0' COMMENT '用户id',
  `goods_description` longtext COMMENT '商品描述',
  PRIMARY KEY (`id`),
  KEY `idx_cid` (`category_id_3`),
  KEY `idx_cman` (`created_man`),
  KEY `idx_sku` (`sku`) USING BTREE,
  KEY `idx_sync` (`synchronization`) USING BTREE,
  KEY `idx_status` (`status`) USING BTREE,
  KEY `idx_uid` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品主表';

