  `platform_in_stock` int(11) DEFAULT '0' COMMENT '平台库存',
  `currency_code` varchar(20) DEFAULT '' COMMENT '货币代码',
  `synchronize_status` int(11) DEFAULT '1' COMMENT '同步状态：1.草稿，2.上架失败，3.已上架，4.已下架，5.更新失败',
  `synchronize_info` varchar(255) DEFAULT '' COMMENT '同步情况消息',
  `goods_id` int(11) DEFAULT '0' COMMENT '本地商品ID',
  `amazon_category_id` varchar(255) DEFAULT '' COMMENT '亚马逊分类ID（该ID需要通过接口请求乐天）',
  `synchronize_from_local_date` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '从本地仓库同步过来的时间',
  `synchronize_to_rakuten_time` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '商品上架至乐天商城时间',
  `created_at` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `brand` varchar(255) DEFAULT '' COMMENT '商品品牌',
  `manufacturer` varchar(255) DEFAULT '' COMMENT '制造商',
  `color` varchar(20) DEFAULT '' COMMENT '产品颜色',
  `goods_size` varchar(20) DEFAULT '' COMMENT '产品型号：如X-Small',
  `goods_status` varchar(100) DEFAULT '' COMMENT '物品状态，如：新货，二手',
  `goods_keywords` varchar(100) DEFAULT '' COMMENT '商品关键词',
  `promotion_price` decimal(12,2) DEFAULT '0.00' COMMENT '促销价',
  `promotion_start_time` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '促销开始时间',
  `promotion_end_time` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '促销结束时间',
  `goods_description` longtext COMMENT '产品描述',
  `goods_weight` decimal(12,2) DEFAULT '0.00' COMMENT '产品重量',
  `goods_height` decimal(12,2) DEFAULT '0.00' COMMENT '产品高度',
  `goods_length` decimal(12,2) DEFAULT '0.00' COMMENT '产品长',
  `goods_width` decimal(12,2) DEFAULT '0.00' COMMENT '产品的宽度',
  `belongs_shop` int(11) DEFAULT '0' COMMENT '所属的店铺ID',
  `goods_label` longtext COMMENT '商品标签，以英文逗号分隔',
  `product_code` varchar(100) DEFAULT '' COMMENT '商品编码',
  `seller_sku` varchar(255) DEFAULT '' COMMENT '商品上架SKU，全平台唯一',
  `product_code_type` tinyint(1) DEFAULT '1' COMMENT '商品编码类型：1.UPC，2.ASIN',
  `goods_name` varchar(255) DEFAULT '' COMMENT '平台（即亚马逊平台）商品名称，独立于本地商品名称，即表内的title',
  `local_sku` varchar(255) DEFAULT '' COMMENT '本地SKU',
  `user_id` int(11) DEFAULT '0' COMMENT '用户id',
  `parentBrowseName` varchar(255) DEFAULT '' COMMENT '节点名称',
  `AmazonBrowseNodeID` varchar(255) DEFAULT '' COMMENT '节点id',
  PRIMARY KEY (`id`),
  KEY `idx_sync` (`synchronize_status`) USING BTREE,
  KEY `idx_mid` (`created_man`) USING BTREE,
  KEY `idx_uid` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='亚马逊商品草稿箱';

