-- ----------------------------
-- Table structure for `orders`
-- ----------------------------
DROP TABLE IF EXISTS `orders`;
CREATE TABLE `orders` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT '0' COMMENT '操作者的主账号id',
  `created_man` int(11) DEFAULT '0' COMMENT '操作者',
  `platforms_id` int(11) DEFAULT '0' COMMENT '关联平台表ID',
  `source_shop` int(11) DEFAULT '0' COMMENT '来源店铺id',
  `order_number` varchar(50) DEFAULT '' COMMENT '订单号',
  `plat_order_number` varchar(50) DEFAULT '' COMMENT '电商单号',
  `type` tinyint(2) DEFAULT '1' COMMENT '1接口获取 2手工创建 3售后 4:合并订单',
  `platform_name` varchar(50) DEFAULT '' COMMENT '来源平台称',
  `source_shop_name` varchar(50) DEFAULT '' COMMENT '来源店铺名称',
  `picking_status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '配货状态 1:未配货 2:已配货 3:部分配货',
  `deliver_status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '发货状态 1:未发货   2:已发货  3:部分发货  ',
  `intercept_status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '拦截状态 1:未拦截 2:拦截中 3:拦截成功 4:拦截失败 ',
  `sales_status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '售中状态 1:未申请部分退款 2:部分退款申请中 3:申请部分退款成功 4:申请部分退款失败 ',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '订单状态 1: 未完结 2:已完结 3:已作废 ',
  `order_price` decimal(16,2) NOT NULL DEFAULT '0.00' COMMENT '订单总金额',
  `currency_code` varchar(10) DEFAULT '' COMMENT '币种code ISO 4217 2019年3月6日16:22:06 新加',
  `rate` decimal(16,4) DEFAULT '0.0000' COMMENT '实时汇率',
  `payment_method` varchar(50) DEFAULT '' COMMENT '付款方式',
  `freight` decimal(10,2) DEFAULT '0.00' COMMENT '运费',
  `currency_freight` varchar(20) DEFAULT '' COMMENT '运费币种 订单这些信息理应不可编辑',
  `postal_code` varchar(20) DEFAULT '' COMMENT '订单邮编',
  `country_id` int(11) DEFAULT '0' COMMENT '国家id',
  `country` varchar(50) DEFAULT '' COMMENT '国家',
  `province` varchar(50) DEFAULT '' COMMENT '省/州',
  `city` varchar(50) DEFAULT '' COMMENT '城市',
  `mobile_phone` varchar(50) DEFAULT '' COMMENT '手机',
  `phone` varchar(50) DEFAULT '' COMMENT '电话',
  `addressee_name` varchar(50) DEFAULT NULL COMMENT '收件人姓名',
  `addressee_email` varchar(50) DEFAULT '' COMMENT '买家邮箱',
  `warehouse_id` int(11) DEFAULT '0' COMMENT '关联的仓库id 订单规则使用',
  `warehouse` varchar(50) DEFAULT '' COMMENT '指定仓库',
  `logistics_id` int(11) DEFAULT '0' COMMENT '物流id',
  `logistics` varchar(50) DEFAULT '' COMMENT '指定物流',
  `addressee` varchar(200) DEFAULT '' COMMENT '收件人地址信息',
  `addressee1` varchar(200) DEFAULT '' COMMENT '地址1',
  `addressee2` varchar(200) DEFAULT '' COMMENT '地址2',
  `mark` varchar(200) DEFAULT '' COMMENT '备注',
  `problem` tinyint(1) DEFAULT '0' COMMENT '配货单问题：0 无问题 1 部分缺货 2 超重需拆包 3 无法找到仓库 4 无法找到物流 5 其他',
  `radio` decimal(16,4) unsigned DEFAULT '0.0000' COMMENT '配货比 0 - 100',
  `cancel_reason` varchar(200) DEFAULT '' COMMENT '取消订单原因备注',
  `intercept_reason` varchar(200) DEFAULT '' COMMENT '拦截原因备注',
  `match_fail_reason` varchar(200) DEFAULT '' COMMENT '匹配失败原因',
  `logistics_time` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '发货时间',
  `order_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '下单时间',
  `payment_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '付款时间',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `logistics_choose_status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '物流指定状态 : 0:否 1:是',
  `warehouse_choose_status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '仓库指定状态 : 0:否 1:是',
  `invoices_freight` decimal(10,2) DEFAULT '0.00' COMMENT '配送费用',
  `invoices_freight_currency_code` varchar(10) DEFAULT 'RMB' COMMENT '配送费用币种code ',
  `merge_orders_id` varchar(255) DEFAULT '' COMMENT '合并订单使用字段',
  PRIMARY KEY (`id`),
  KEY `idx_cman` (`created_man`),
  KEY `idx_ssid` (`source_shop`),
  KEY `idx_pid` (`platforms_id`),
  KEY `idx_status` (`status`),
  KEY `idx_pstatus` (`picking_status`),
  KEY `idx_ocode` (`order_number`),
  KEY `idx_uid` (`user_id`),
  KEY `idx_pocode` (`plat_order_number`),
  KEY `idx_lcs` (`logistics_choose_status`),
  KEY `idx_wcs` (`warehouse_choose_status`),
  KEY `idx_pro` (`problem`) USING BTREE,
  KEY `idx_coun` (`country_id`) USING BTREE,
  KEY `idx_inter` (`intercept_status`) USING BTREE,
  KEY `idx_sa` (`sales_status`) USING BTREE,
  KEY `idx_dev` (`deliver_status`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='平台订单表';

-- ----------------------------
-- Records of orders
-- ----------------------------

-- ----------------------------
-- Table structure for `orders_after_sales`
-- ----------------------------
DROP TABLE IF EXISTS `orders_after_sales`;
CREATE TABLE `orders_after_sales` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `created_man` int(11) DEFAULT '0' COMMENT '操作者',
  `order_id` int(11) DEFAULT '0' COMMENT '订单表id',
  `swap_order_id` int(11) DEFAULT '0' COMMENT '换货订单表id',
  `resolvent_id` int(11) DEFAULT '0' COMMENT '关联处理方式的表Resolvent.id',
  `invoice_id` int(11) DEFAULT '0' COMMENT '配货单的ID',
  `warehouse_id` int(11) DEFAULT '0' COMMENT '仓库id',
  `after_sale_code` varchar(50) DEFAULT '' COMMENT '售后单号',
  `type` tinyint(2) NOT NULL DEFAULT '1' COMMENT '操作类型 1 退货 2 换货 3 退款',
  `sales_return_status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '商品是否退回状态 1:未退回 2:已退回 3:卖家确认收货',
  `again_deliver_status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '是否重新发货状态 1:未发货 2:已发货',
  `refund` decimal(16,2) DEFAULT '0.00' COMMENT '退款金额',
  `supplement` decimal(16,2) DEFAULT '0.00' COMMENT '补款金额',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `currency_code` varchar(10) DEFAULT '' COMMENT '币种code ISO 4217 2019年3月6日16:22:06 新加',
  `rate` decimal(16,4) DEFAULT '0.0000' COMMENT '实时汇率',
  `payments_code` varchar(50) NOT NULL DEFAULT '' COMMENT '付款单号',
  `is_cancel` tinyint(2) NOT NULL DEFAULT '1' COMMENT '是否作废 1:正常 2:作废',
  `user_id` tinyint(2) NOT NULL DEFAULT '0' COMMENT '子账号记录父id',
  PRIMARY KEY (`id`),
  KEY `idx_cman` (`created_man`),
  KEY `idx_oid` (`order_id`),
  KEY `idx_soid` (`swap_order_id`),
  KEY `idx_rid` (`resolvent_id`),
  KEY `idx_iid` (`invoice_id`),
  KEY `idx_wid` (`warehouse_id`),
  KEY `idx_uid` (`user_id`) USING BTREE,
  KEY `idx_is` (`is_cancel`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='售后单';

-- ----------------------------
-- Records of orders_after_sales
-- ----------------------------

-- ----------------------------
-- Table structure for `orders_after_sales_products`
-- ----------------------------
DROP TABLE IF EXISTS `orders_after_sales_products`;
CREATE TABLE `orders_after_sales_products` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `created_man` int(11) DEFAULT '0' COMMENT '操作者',
  `after_sale_id` int(11) DEFAULT '0' COMMENT '售后单的ID',
  `product_name` varchar(100) DEFAULT '' COMMENT '平台订单商品名称',
  `sku` varchar(100) DEFAULT '' COMMENT '平台商品的sku',
  `attribute` varchar(20) DEFAULT '' COMMENT '属性',
  `number` int(11) DEFAULT '0' COMMENT '数量',
  `univalence` decimal(16,2) NOT NULL DEFAULT '0.00' COMMENT '单价',
  `rate` decimal(16,4) DEFAULT '0.0000' COMMENT '实时汇率',
  `currency` varchar(20) DEFAULT '' COMMENT '币种',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `goods_id` int(11) DEFAULT '0' COMMENT '商品的Id',
  PRIMARY KEY (`id`),
  KEY `idx_cman` (`created_man`),
  KEY `idx_asid` (`after_sale_id`),
  KEY `idx_gid` (`goods_id`) USING BTREE,
  KEY `idx_sku` (`sku`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='售后单商品';

-- ----------------------------
-- Records of orders_after_sales_products
-- ----------------------------

-- ----------------------------
-- Table structure for `orders_amazon`
-- ----------------------------
DROP TABLE IF EXISTS `orders_amazon`;
CREATE TABLE `orders_amazon` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `AmazonOrderId` varchar(50) DEFAULT '' COMMENT '亚马逊所定义的订单编码，格式为 3-7-7',
  `SellerOrderId` varchar(50) DEFAULT '' COMMENT '卖家所定义的订单编码。',
  `created_man` int(11) DEFAULT '0' COMMENT '卖家id',
  `cw_order_id` int(11) DEFAULT '0' COMMENT '平台订单id',
  `is_system` tinyint(1) DEFAULT '0' COMMENT '是否系统订单 1是 0否',
  `cw_code` varchar(50) DEFAULT '' COMMENT 'cw_rep平台订单号',
  `RequestId` varchar(50) DEFAULT '' COMMENT '请求编号id ResponseMetadata',
  `MarketplaceId` varchar(20) DEFAULT '' COMMENT '订单生成所在商城的匿名编码',
  `OrderStatus` varchar(20) DEFAULT '' COMMENT '当前的订单状态',
  `MatchStatus` tinyint(2) NOT NULL DEFAULT '1' COMMENT '1:未匹配 2:已匹配 3:匹配失败',
  `Amount` decimal(10,2) DEFAULT '0.00' COMMENT '总金额 OrderTotal 下 ',
  `CurrencyCode` varchar(3) DEFAULT '' COMMENT '三位数的货币代码。格式为 ISO 4217 OrderTotal 下',
  `PaymentMethodDetails` varchar(1000) DEFAULT '' COMMENT '付款详情json',
  `OrderType` varchar(20) DEFAULT '' COMMENT '亚马逊订单类型 StandardOrder',
  `Name` varchar(200) DEFAULT '' COMMENT '收货人名称',
  `Phone` varchar(50) DEFAULT '' COMMENT '电话号码',
  `PostalCode` varchar(20) DEFAULT '' COMMENT '邮政编码',
  `CountryCode` varchar(10) DEFAULT '' COMMENT '两位数国家/地区代码。格式为 ISO 3166-1-alpha 2 ',
  `StateOrRegion` varchar(50) DEFAULT '' COMMENT '省/自治区/直辖市或地区',
  `City` varchar(50) DEFAULT '' COMMENT '城市',
  `AddressLine1` varchar(50) DEFAULT '' COMMENT '街道地址。',
  `AddressLine2` varchar(50) DEFAULT '' COMMENT '其他街道地址信息（如果需要）',
  `AddressLine3` varchar(50) DEFAULT '' COMMENT '其他街道地址信息（如果需要）',
  `SalesChannel` varchar(20) DEFAULT '' COMMENT '订单中第一件商品的销售渠道',
  `BuyerEmail` varchar(50) DEFAULT '' COMMENT '买家电子邮件地址',
  `ShipServiceLevel` varchar(255) DEFAULT '' COMMENT '货件服务水平',
  `FulfillmentChannel` varchar(10) DEFAULT '' COMMENT '订单配送方式：亚马逊配送 (AFN) 或卖家自行配送 (MFN)。',
  `NumberOfItemsShipped` varchar(20) DEFAULT '0' COMMENT '发货数量',
  `NumberOfItemsUnshipped` varchar(20) DEFAULT '0' COMMENT '未发货数量',
  `PaymentMethod` varchar(20) DEFAULT '' COMMENT '订单的主要付款方式',
  `BuyerName` varchar(50) DEFAULT '' COMMENT '买家姓名',
  `IsReplacementOrder` varchar(20) DEFAULT '' COMMENT '是否是换货单 更换订单',
  `IsBusinessOrder` varchar(20) DEFAULT '' COMMENT '是否是业务订单',
  `IsPremiumOrder` varchar(20) DEFAULT '' COMMENT '是否是保险单',
  `IsPrime` varchar(20) DEFAULT '' COMMENT '是否是Prime会员订单',
  `is_update` tinyint(1) DEFAULT '0' COMMENT '是否已更新状态',
  `update_count` tinyint(3) NOT NULL DEFAULT '0' COMMENT '更新次数',
  `PurchaseDate` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '创建订单的日期 ',
  `PaymentDate` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '付款时间',
  `LastUpdateDate` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '订单的最后更新日期',
  `LocalPurchaseDate` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '订单创建日期的当地时间',
  `EarliestShipDate` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '订单最早的发货日期',
  `LatestShipDate` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '承诺的订单发货时间范围的最后一天。日期格式为 ISO 8601',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '记录修改时间',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `ShipmentServiceLevelCategory` varchar(50) DEFAULT '' COMMENT '订单的配送服务级别分类',
  `goods_amount` decimal(10,2) DEFAULT '0.00' COMMENT '商品总价',
  `freight` decimal(10,2) DEFAULT '0.00' COMMENT '运费',
  `excise` decimal(10,2) DEFAULT '0.00' COMMENT '税费',
  PRIMARY KEY (`id`),
  KEY `idx_cw_code` (`cw_code`),
  KEY `idx_cman` (`created_man`),
  KEY `idx_update_time` (`update_time`),
  KEY `idx_cwoid` (`cw_order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='亚马逊订单同步表';

-- ----------------------------
-- Records of orders_amazon
-- ----------------------------

-- ----------------------------
-- Table structure for `orders_amazon_products`
-- ----------------------------
DROP TABLE IF EXISTS `orders_amazon_products`;
CREATE TABLE `orders_amazon_products` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned DEFAULT '0' COMMENT '客户id',
  `amazon_order_id` int(11) DEFAULT '0' COMMENT '乐天订单表id',
  `goods_id` int(11) DEFAULT '0' COMMENT '商品id',
  `ASIN` varchar(100) DEFAULT '' COMMENT '商品的亚马逊标准识别号 (ASIN)',
  `SellerSKU` varchar(100) DEFAULT '' COMMENT '商品的卖家 (SellerSKU)',
  `OrderItemId` varchar(100) DEFAULT '' COMMENT '亚马逊定义的订单商品识别号',
  `Title` varchar(100) DEFAULT '' COMMENT '商品名称',
  `QuantityOrdered` varchar(100) DEFAULT '' COMMENT '下面两个子元素的父元素',
  `QuantityShipped` varchar(100) DEFAULT '' COMMENT '已配送的商品数量',
  `ItemPrice` varchar(100) DEFAULT '' COMMENT '订单商品的售价 ItemPrice 的价值等于商品售价乘以订购数量。请注意： ItemPrice 不包括ShippingPrice 和GiftWrapPrice',
  `CurrencyCode` varchar(3) DEFAULT '' COMMENT '三位数的货币代码。格式为 ISO 4217 OrderTotal 下',
  `unit_discount_price` varchar(100) DEFAULT '' COMMENT '订单商品的折扣之后单价',
  `ShippingPrice` varchar(100) DEFAULT '' COMMENT '运费',
  `GiftWrapPrice` varchar(100) DEFAULT '' COMMENT '商品的礼品包装金额',
  `ItemTax` varchar(20) DEFAULT '' COMMENT '商品价格的税费',
  `ShippingTax` varchar(20) DEFAULT '' COMMENT '运费的税费',
  `shipping_fee` varchar(100) DEFAULT '' COMMENT '优惠后运费',
  `GiftWrapTax` varchar(20) DEFAULT '' COMMENT '礼品包装金额的税费',
  `ShippingDiscount` varchar(20) DEFAULT '' COMMENT '运费的折扣',
  `PromotionDiscount` varchar(20) DEFAULT '' COMMENT '报价中的全部促销折扣总计',
  `PromotionIds` varchar(20) DEFAULT '' COMMENT 'PromotionId 元素列表',
  `CODFee` varchar(20) DEFAULT '' COMMENT 'COD 货到付款 服务费用',
  `CODFeeDiscount` varchar(20) DEFAULT '' COMMENT '货到付款费用的折扣 CODFeeDiscount 是仅在日本 (JP) 使用的响应元素',
  `GiftMessageText` varchar(100) DEFAULT '' COMMENT '买家提供的礼品消息',
  `GiftWrapLevel` varchar(100) DEFAULT '' COMMENT '买家指定的礼品包装等级',
  `InvoiceData` varchar(100) DEFAULT '' COMMENT '发票信息仅适用于中国',
  `ConditionNote` varchar(100) DEFAULT '' COMMENT '卖家描述的商品状况',
  `ConditionId` varchar(100) DEFAULT '' COMMENT '商品的状况 New Used Collectible Refurbished Preorder Club',
  `ConditionSubtypeId` varchar(100) DEFAULT '' COMMENT '商品的状况 New,Mint,Very Good,Good,Acceptable,Poor,Club,OEM,Warranty,Refurbished Warranty ,Refurbished ,Open Box, Any, Other',
  `ScheduledDeliveryStartDate` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `ScheduledDeliveryEndDate` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `idx_uid` (`user_id`),
  KEY `idx_aoid` (`amazon_order_id`),
  KEY `idx_gid` (`goods_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='亚马逊订单商品表';

-- ----------------------------
-- Records of orders_amazon_products
