-- ----------------------------
-- Table structure for `orders_bill_payments`
-- ----------------------------
DROP TABLE IF EXISTS `orders_bill_payments`;
CREATE TABLE `orders_bill_payments` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `created_man` int(11) DEFAULT '0' COMMENT '操作者',
  `order_id` int(11) DEFAULT '0' COMMENT '订单表id',
  `order_type` tinyint(2) NOT NULL DEFAULT '1' COMMENT '订单类型 1:原始订单乐天 2:原始订单亚马逊 3:平台订单',
  `status` tinyint(2) DEFAULT '0' COMMENT '状态 : 退款状态下 0:退款中 1:退款完成 2:退款取消或失败',
  `type` tinyint(2) NOT NULL DEFAULT '1' COMMENT '操作类型 1 付款 2 退款',
  `amount` decimal(16,2) NOT NULL DEFAULT '0.00' COMMENT '付款金额',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `currency_code` varchar(10) DEFAULT '' COMMENT '币种code ISO 4217 2019年3月6日16:22:06 新加',
  `rate` decimal(16,4) DEFAULT '0.0000' COMMENT '实时汇率',
  `bill_code` varchar(50) DEFAULT '' COMMENT '付款|退款单号',
  PRIMARY KEY (`id`),
  KEY `idx_cman` (`created_man`),
  KEY `idx_oid` (`order_id`),
  KEY `idx_otype` (`order_type`),
  KEY `idx_type` (`type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单 付|退款单';

-- ----------------------------
-- Records of orders_bill_payments
-- ----------------------------

-- ----------------------------
-- Table structure for `orders_invoice_products`
-- ----------------------------
DROP TABLE IF EXISTS `orders_invoice_products`;
CREATE TABLE `orders_invoice_products` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `created_man` int(11) DEFAULT '0' COMMENT '操作者',
  `user_id` int(11) unsigned DEFAULT '0' COMMENT '子账号',
  `order_id` int(11) DEFAULT '0' COMMENT '订单表id',
  `invoice_id` int(11) DEFAULT '0' COMMENT '配货单的ID',
  `goods_id` int(11) DEFAULT '0' COMMENT '商品的Id',
  `product_name` varchar(100) DEFAULT '' COMMENT '平台订单商品名称',
  `sku` varchar(100) DEFAULT '' COMMENT '平台商品的sku',
  `attribute` varchar(20) NOT NULL DEFAULT '' COMMENT '属性',
  `buy_number` int(11) unsigned DEFAULT '0' COMMENT '购买数量',
  `already_stocked_number` int(11) unsigned DEFAULT '0' COMMENT '已配货数量',
  `cargo_distribution_number` int(11) DEFAULT NULL COMMENT '可配货数量',
  `weight` decimal(16,2) NOT NULL DEFAULT '0.00' COMMENT '重量',
  `univalence` decimal(16,2) NOT NULL DEFAULT '0.00' COMMENT '单价',
  `rate` decimal(16,4) DEFAULT '0.0000' COMMENT '实时汇率',
  `currency` varchar(20) DEFAULT '' COMMENT '币种',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '配货是否完成： 0 未完成 1 已完成',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `AmazonOrderItemCode` varchar(100) DEFAULT '' COMMENT '亚马逊定义的订单商品识别号',
  PRIMARY KEY (`id`),
  KEY `idx_cman` (`created_man`),
  KEY `idx_oid` (`order_id`),
  KEY `idx_iid` (`invoice_id`),
  KEY `idx_gid` (`goods_id`),
  KEY `idx_uid` (`user_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='配货单商品表';

-- ----------------------------
-- Records of orders_invoice_products
