-- ----------------------------
-- Table structure for `orders_invoices`
-- ----------------------------
DROP TABLE IF EXISTS `orders_invoices`;
CREATE TABLE `orders_invoices` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `type` tinyint(1) unsigned DEFAULT '1' COMMENT '仓库类型：1 速贸仓储 2 自定义',
  `created_man` int(11) DEFAULT '0' COMMENT '操作者',
  `user_id` int(11) DEFAULT '0' COMMENT '子账号',
  `order_id` int(11) DEFAULT '0' COMMENT '订单表id',
  `platforms_id` int(11) DEFAULT '0' COMMENT '平台id',
  `source_shop` int(11) DEFAULT '0' COMMENT '来源店铺id',
  `logistics_id` int(11) DEFAULT '0' COMMENT '物流方式id',
  `logistics_way` varchar(50) DEFAULT '' COMMENT '物流方式',
  `warehouse_id` int(11) DEFAULT '0' COMMENT '仓库id',
  `warehouse` varchar(50) DEFAULT '' COMMENT '仓库',
  `invoices_number` varchar(50) DEFAULT '' COMMENT '配货单号',
  `warehouse_order_number` varchar(50) DEFAULT '' COMMENT '仓库单号 用来对接仓库操作',
  `tracking_no` varchar(50) DEFAULT '' COMMENT '物流跟踪号',
  `taotla_value` decimal(16,2) DEFAULT '0.00' COMMENT '运费',
  `currency_code` varchar(10) DEFAULT '' COMMENT '币种code ISO 4217 ',
  `delivery_status` tinyint(2) unsigned DEFAULT '1' COMMENT '发货状态：1 未发货 2 已发货',
  `rate` decimal(16,4) DEFAULT '0.0000' COMMENT '实时汇率',
  `intercept_status` tinyint(1) unsigned DEFAULT '1' COMMENT '拦截状态 1:未拦截 2:拦截中 3:拦截成功 4:拦截失败 ',
  `invoices_status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '配货单状态 1:未作废 2:已作废 3:已删除',
  `sync_status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '仓库拿物流跟踪号 再回传平台 同步状态 1:未同步 2:已同步 3:同步失败 ',
  `sync_number` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '同步至平台次数',
  `state` tinyint(2) unsigned DEFAULT '1' COMMENT '是否更新已发货数：1 未更新 2 已更新',
  `ware_number` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '仓库获取跟踪号次数',
  `delivered_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '发货时间',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `pass_back_status` tinyint(2) DEFAULT '0' COMMENT '物流跟踪号回传状态 0:未回传 1:已回传 2:回传失败',
  `pass_back_count` tinyint(2) DEFAULT '0' COMMENT '物流跟踪号回传次数 失败时使用',
  `pass_back_fail_info` varchar(255) DEFAULT '' COMMENT '回传失败异常信息记录',
  PRIMARY KEY (`id`),
  KEY `idx_cman` (`created_man`),
  KEY `idx_oid` (`order_id`),
  KEY `idx_whid` (`warehouse_id`),
  KEY `idx_invcode` (`invoices_number`),
  KEY `idx_logcode` (`warehouse_order_number`),
  KEY `idx_lid` (`logistics_id`),
  KEY `idx_platform` (`platforms_id`) USING BTREE,
  KEY `idx_source` (`source_shop`) USING BTREE,
  KEY `idx_uid` (`user_id`) USING BTREE,
  KEY `idx_type` (`type`) USING BTREE,
  KEY `idx_delivery` (`delivery_status`) USING BTREE,
  KEY `idx_state` (`state`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='配货单表';

