-- ----------------------------
-- Table structure for `orders_logs`
-- ----------------------------
DROP TABLE IF EXISTS `orders_logs`;
CREATE TABLE `orders_logs` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `created_man` int(11) DEFAULT '0' COMMENT '操作者',
  `order_id` int(11) DEFAULT '0' COMMENT '订单表id',
  `behavior_type_desc` varchar(255) DEFAULT '' COMMENT '操作类型描述',
  `behavior_types` tinyint(2) DEFAULT '1' COMMENT '操作类型 1:创建订单 2:编辑订单 3:拦截订单 4:拦截失败 5:拦截成功   6:取消订单 7:部分商品退款 8:退款成功 9:退款失败  10:部分配货 11:配货成功 12:部分发货 13:发货成功  14:创建售后单 15:订单完结 16:订单作废 17:订单问题规则匹配',
  `behavior_desc` text COMMENT '操作描述',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `idx_cman` (`created_man`),
  KEY `idx_oid` (`order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单日志';

