-- ----------------------------
-- Table structure for `orders_original`
-- ----------------------------
DROP TABLE IF EXISTS `orders_original`;
CREATE TABLE `orders_original` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `created_man` int(11) DEFAULT '0' COMMENT '操作者',
  `platform` int(11) DEFAULT '0' COMMENT '关联平台表ID',
  `source_shop` int(11) DEFAULT '0' COMMENT '来源店铺id',
  `bill_payments` int(11) DEFAULT '0' COMMENT '付款单id',
  `order_id` int(11) DEFAULT '0' COMMENT '订单表id',
  `order_number` varchar(50) DEFAULT '' COMMENT '原始ERP',
  `platform_order` varchar(100) DEFAULT NULL COMMENT '来源平台订单号（亚马逊、乐天的）',
  `platform_name` varchar(50) DEFAULT '' COMMENT '来源平台称',
  `source_shop_name` varchar(50) DEFAULT '' COMMENT '来源店铺名称',
  `match_status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '1:未匹配 2:已匹配 3:匹配失败',
  `order_price` decimal(16,2) NOT NULL DEFAULT '0.00' COMMENT '订单总金额',
  `payment_method` varchar(50) DEFAULT '' COMMENT '付款方式',
  `freight` decimal(10,2) DEFAULT '0.00' COMMENT '运费',
  `currency_freight` varchar(20) DEFAULT '' COMMENT '运费币种 订单这些信息理应不可编辑',
  `country` varchar(50) DEFAULT '' COMMENT '国家',
  `province` varchar(50) DEFAULT '' COMMENT '省/州',
  `city` varchar(50) DEFAULT '' COMMENT '城市',
  `mobile_phone` varchar(50) DEFAULT '' COMMENT '手机',
  `phone` varchar(50) DEFAULT '' COMMENT '电话',
  `addressee_email` varchar(50) DEFAULT '' COMMENT '买家邮箱',
  `warehouse` varchar(50) DEFAULT '' COMMENT '指定仓库',
  `logistics` varchar(50) DEFAULT '' COMMENT '指定物流',
  `addressee_name` varchar(200) DEFAULT '' COMMENT '收件人',
  `addressee1` varchar(200) DEFAULT '' COMMENT '地址1',
  `addressee2` varchar(200) DEFAULT '' COMMENT '地址2',
  `mark` varchar(200) DEFAULT '' COMMENT '备注',
  `match_fail_reason` varchar(200) DEFAULT '' COMMENT '匹配失败原因',
  `order_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '下单时间',
  `payment_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '付款时间',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `currency` varchar(20) DEFAULT '' COMMENT '订单币种',
  `order_source` tinyint(2) DEFAULT '1' COMMENT '订单来源：1.平台订单，2.手工订单',
  `user_id` int(11) DEFAULT '0' COMMENT '父级账号ID',
  `grab_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '抓取时间',
  `zip_code` varchar(50) DEFAULT '' COMMENT '邮编',
  `rate` decimal(16,4) DEFAULT NULL COMMENT '实时汇率',
  `logistics_id` int(11) DEFAULT NULL COMMENT '物流ID',
  `warehouse_id` int(11) DEFAULT NULL COMMENT '仓库ID',
  `country_id` int(11) DEFAULT NULL COMMENT '国家ID',
  `order_source_id` int(11) DEFAULT '0' COMMENT '来源订单id',
  PRIMARY KEY (`id`),
  KEY `idx_cman` (`created_man`),
  KEY `idx_ssid` (`source_shop`),
  KEY `idx_bpid` (`bill_payments`),
  KEY `idx_pid` (`platform`),
  KEY `idx_osid` (`order_source_id`),
  KEY `idx_country` (`country_id`) USING BTREE,
  KEY `idx_match` (`match_status`) USING BTREE,
  KEY `idx_soure` (`order_source`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='原始订单表 手动创建 导入';

