  `product_name` varchar(100) DEFAULT '' COMMENT '平台订单商品名称',
  `sku` varchar(100) DEFAULT '' COMMENT '平台商品的sku',
  `currency` varchar(20) DEFAULT '' COMMENT '币种',
  `buy_number` int(11) DEFAULT '0' COMMENT '购买数量',
  `already_stocked_number` int(11) DEFAULT '0' COMMENT '已配货数量',
  `cargo_distribution_number` int(11) unsigned DEFAULT '0' COMMENT '可配货数量',
  `delivery_number` int(11) DEFAULT '0' COMMENT '已发货数',
  `partial_refund_number` int(11) DEFAULT '0' COMMENT '部分退款数量',
  `weight` decimal(16,2) NOT NULL DEFAULT '0.00' COMMENT '重量',
  `univalence` decimal(16,2) NOT NULL DEFAULT '0.00' COMMENT '单价',
  `rate` decimal(16,4) DEFAULT '0.0000' COMMENT '实时汇率',
  `RMB` decimal(16,2) NOT NULL DEFAULT '0.00' COMMENT '转换后的人民币',
