  `buyer_familyName` varchar(100) DEFAULT '' COMMENT '买家姓',
  `buyer_familyNameKana` varchar(100) DEFAULT '' COMMENT '买家姓',
  `buyer_firstName` varchar(100) DEFAULT '' COMMENT '买家名',
  `buyer_firstNameKana` varchar(100) DEFAULT '' COMMENT '买家名',
  `buyer_phoneNumber1` varchar(10) DEFAULT '' COMMENT '买家号码1',
  `buyer_phoneNumber2` varchar(10) DEFAULT '' COMMENT '买家号码2',
