  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `created_man` int(11) DEFAULT '0' COMMENT '操作者',
  `condition_id` int(11) NOT NULL DEFAULT '0' COMMENT '关联条件表ID',
  `trouble_rule_id` int(11) NOT NULL DEFAULT '0' COMMENT '规则id',
