  `condition_prefix` varchar(50) DEFAULT '' COMMENT '条件前缀名称',
  `cond_val` varchar(500) DEFAULT '' COMMENT '条件值',
  `cond_unit` varchar(50) DEFAULT '' COMMENT '单位',
  `condition_name` varchar(50) DEFAULT '' COMMENT '条件名列表展示',
  `sertid` varchar(20) DEFAULT '' COMMENT 'sert id',
  `relid` varchar(20) DEFAULT '' COMMENT 'relid li id',
  `input_field` varchar(50) DEFAULT '' COMMENT '表单字段名',
  `cond_name` text COMMENT '规则描述字段',
  `cond_type` tinyint(2) DEFAULT '0' COMMENT '类型 如：计算类型 枚举 ',
  `operator` varchar(50) DEFAULT '' COMMENT '运算符 $operator',
