  `related` varchar(20) DEFAULT '' COMMENT '关联模型',
  `condition_sql` varchar(500) DEFAULT '' COMMENT '条件sql 譬如 指定平台 WHERE $operator $filedVal 其中 $operator = IN $filedVal = (1,2,3) 变量 替换 ',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `idx_cman` (`created_man`),
  KEY `idx_cid` (`condition_id`),
  KEY `idx_trid` (`trouble_rule_id`),
  KEY `idx_uid` (`user_id`),
  KEY `idx_ustatus` (`is_used`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='仓库规则条件关联表';

