  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  PRIMARY KEY (`user_id`),
  KEY `idx_cman` (`created_man`),
  KEY `idx_ucode` (`user_code`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='用户表';

-- ----------------------------
-- Records of user
-- ----------------------------

-- ----------------------------
-- Table structure for `user_forget_massage`
-- ----------------------------
DROP TABLE IF EXISTS `user_forget_massage`;
CREATE TABLE `user_forget_massage` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `service_type` tinyint(2) DEFAULT '1' COMMENT '服务类型  1:短信SMS  2:邮箱 ',
  `send_to` varchar(150) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '发送至:手机号 或 邮箱',
  `ip_addr` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT '0' COMMENT '客户ip',
  `service_code` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '0' COMMENT '短信验证码|邮箱秘钥',
  `service_record` text COLLATE utf8mb4_unicode_ci COMMENT '服务备注 记录异常信息',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '使用状态 0:未使用 1:已使用 2:已过期',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `idx_scode` (`service_code`),
  KEY `idx_uid` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='用户忘记密码记录';

-- ----------------------------
-- Records of user_forget_massage
-- ----------------------------

-- ----------------------------
-- Table structure for `warehouse_goods`
-- ----------------------------
DROP TABLE IF EXISTS `warehouse_goods`;
CREATE TABLE `warehouse_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) DEFAULT '0' COMMENT 'goods表主键',
  `currency_id` int(11) DEFAULT '0' COMMENT '币种id',
  `created_man` int(11) DEFAULT '0' COMMENT '操作者',
  `sku` varchar(50) DEFAULT '' COMMENT '商品SKU',
  `goods_name` varchar(100) DEFAULT '' COMMENT '商品名称',
  `isset_battery` tinyint(2) DEFAULT '0' COMMENT '货物属性，0:不含电池，1:含电池',
  `bases` varchar(500) DEFAULT '' COMMENT '主要成分',
  `goods_height` decimal(10,2) DEFAULT '0.00' COMMENT '高，单位CM',
  `goods_width` decimal(10,2) DEFAULT '0.00' COMMENT '宽，单位CM',
  `goods_length` decimal(10,2) DEFAULT '0.00' COMMENT '长，单位CM',
  `goods_weight` decimal(10,2) DEFAULT '0.00' COMMENT '重量,单位KG',
  `product_title` varchar(250) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '产品名称',
  `ch_name` varchar(250) DEFAULT '' COMMENT '申报中文名',
  `eh_name` varchar(250) DEFAULT '' COMMENT '申报英文名',
  `price` decimal(20,2) DEFAULT '0.00' COMMENT '申报价值',
  `warehouse_category1` varchar(100) DEFAULT '' COMMENT '1级仓库分类',
  `warehouse_category2` varchar(100) DEFAULT '' COMMENT '2级仓库分类',
  `warehouse_category3` varchar(100) DEFAULT '' COMMENT '3级仓库分类',
  `sync` tinyint(2) DEFAULT '0' COMMENT '0: 未同步 1：同步成功 2：同步中',
  `sync_time` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '同步时间',
  `reason` varchar(500) DEFAULT '' COMMENT '同步失败原因',
  `purchase_inventory` int(11) DEFAULT '0' COMMENT '采购库存',
  `in_transit_inventory` int(11) DEFAULT '0' COMMENT '在途库存',
  `drop_shipping` int(11) DEFAULT '0' COMMENT '代发货',
  `available_in_stock` int(11) DEFAULT '0' COMMENT '可用库存',
  `sale_in_stock` int(11) DEFAULT '0' COMMENT '可售库存',
  `created_at` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `user_id` int(11) DEFAULT '0' COMMENT '用户id',
  PRIMARY KEY (`id`),
  KEY `idx_cman` (`created_man`),
  KEY `idx_gid` (`goods_id`),
  KEY `idx_curid` (`currency_id`),
  KEY `idx_uid` (`user_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='仓库商品';

-- ----------------------------
-- Records of warehouse_goods
-- ----------------------------

-- ----------------------------
-- Table structure for `warehouse_secretkey`
-- ----------------------------
DROP TABLE IF EXISTS `warehouse_secretkey`;
CREATE TABLE `warehouse_secretkey` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `created_man` int(11) unsigned DEFAULT '0' COMMENT '操作者',
  `appToken` varchar(255) NOT NULL COMMENT '仓库appToken',
  `appKey` varchar(255) NOT NULL COMMENT '仓库appKey',
  `status` int(1) unsigned DEFAULT '1' COMMENT '是否启用：1 启用 2禁用',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `user_id` int(11) DEFAULT '0' COMMENT '操作者 主账号id',
  PRIMARY KEY (`id`),
  KEY `idx_cman` (`created_man`) USING BTREE,
  KEY `idx_uid` (`user_id`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of warehouse_secretkey
-- ----------------------------

-- ----------------------------
-- Table structure for `warehouse_troubles_record`
-- ----------------------------
DROP TABLE IF EXISTS `warehouse_troubles_record`;
CREATE TABLE `warehouse_troubles_record` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `manage_id` int(11) DEFAULT '0' COMMENT '处理人id',
  `created_man` int(11) DEFAULT '0' COMMENT '操作者',
  `order_id` int(11) DEFAULT '0' COMMENT '订单表id',
  `trouble_rule_id` int(11) DEFAULT '0' COMMENT '订单规则ID ',
  `question_type` tinyint(2) DEFAULT '1' COMMENT '问题类型 1:订单问题 2:仓库问题 3:物流问题 4:拦截订单',
  `trouble_name` varchar(100) DEFAULT '' COMMENT '问题名称',
  `trouble_desc` varchar(255) DEFAULT '' COMMENT '规则描述',
  `manage_remark` varchar(255) DEFAULT '' COMMENT '备注',
  `dispose_status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '处理状态 1:待处理 2:已处理',
  `created_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `idx_cman` (`created_man`),
  KEY `idx_oid` (`order_id`),
  KEY `idx_trid` (`trouble_rule_id`),
  KEY `idx_type` (`question_type`),
  KEY `idx_status` (`dispose_status`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='仓库问题记录表';

-- ----------------------------
-- Records of warehouse_troubles_record
-- ----------------------------

-- ----------------------------
-- Table structure for `warehouse_type_goods`
-- ----------------------------
DROP TABLE IF EXISTS `warehouse_type_goods`;
CREATE TABLE `warehouse_type_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `created_man` int(11) DEFAULT '0' COMMENT '操作者',
  `goods_id` int(11) DEFAULT '0' COMMENT '本地商品id',
  `setting_warehouse_id` int(11) DEFAULT '0' COMMENT '仓库id',
  `purchase_inventory` int(11) DEFAULT '0' COMMENT '采购库存',
  `in_transit_inventory` int(11) DEFAULT '0' COMMENT '在途库存',
  `drop_shipping` int(11) DEFAULT '0' COMMENT '待发货',
  `available_in_stock` int(11) unsigned DEFAULT '0' COMMENT '可用库存',
  `created_at` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `user_id` int(11) DEFAULT '0' COMMENT '操作者的主账号id',
  PRIMARY KEY (`id`),
  KEY `idx_uid` (`user_id`) USING BTREE,
  KEY `idx_gid` (`goods_id`) USING BTREE,
  KEY `idx_wid` (`setting_warehouse_id`) USING BTREE,
  KEY `idx_mid` (`created_man`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='仓库商品与仓库中间表';

